import React, { useState, useEffect } from 'react';
import './Home.css';

const Home = () => {
  const [timeLeft, setTimeLeft] = useState({});
  const [currentSlide, setCurrentSlide] = useState(0);

  const slides = [
    {
      title: "PHARMORA - 1.0",
      subtitle: "NATIONAL CONFERENCE",
      description: "Fostering Innovation for a Healthier Tomorrow: Navigating the Future of Pharmaceutical Sciences",
      theme: "FIHTNFPS - 2025",
      date: "2025",
      organizer: "FACULTY OF PHARMACY, UNITED UNIVERSITY PRAYAGRAJ"
    },
    {
      title: "PHARMORA - 1.0",
      subtitle: "RESEARCH EXCELLENCE",
      description: "Join leading pharmaceutical researchers and industry experts in advancing healthcare innovation",
      theme: "Pharmaceutical Research & Development",
      date: "2025",
      organizer: "FACULTY OF PHARMACY, UNITED UNIVERSITY PRAYAGRAJ"
    },
    {
      title: "PHARMORA - 1.0",
      subtitle: "FUTURE OF PHARMACY",
      description: "Exploring cutting-edge pharmaceutical technologies and therapeutic innovations",
      theme: "Innovation in Drug Discovery",
      date: "2025",
      organizer: "FACULTY OF PHARMACY, UNITED UNIVERSITY PRAYAGRAJ"
    }
  ];

  useEffect(() => {
    const conferenceDate = new Date('2025-03-15T09:00:00').getTime();

    const timer = setInterval(() => {
      const now = new Date().getTime();
      const difference = conferenceDate - now;

      if (difference > 0) {
        setTimeLeft({
          days: Math.floor(difference / (1000 * 60 * 60 * 24)),
          hours: Math.floor((difference % (1000 * 60 * 60 * 24)) / (1000 * 60 * 60)),
          minutes: Math.floor((difference % (1000 * 60 * 60)) / (1000 * 60)),
          seconds: Math.floor((difference % (1000 * 60)) / 1000)
        });
      }
    }, 1000);

    return () => clearInterval(timer);
  }, []);

  useEffect(() => {
    const slideTimer = setInterval(() => {
      setCurrentSlide(prev => (prev + 1) % slides.length);
    }, 5000);

    return () => clearInterval(slideTimer);
  }, [slides.length]);

  const nextSlide = () => {
    setCurrentSlide(prev => (prev + 1) % slides.length);
  };

  const prevSlide = () => {
    setCurrentSlide(prev => (prev - 1 + slides.length) % slides.length);
  };

  const goToSlide = (index) => {
    setCurrentSlide(index);
  };

  return (
    <section id="home" className="home">
      <div className="slideshow-container">
        {slides.map((slide, index) => (
          <div key={index} className={`slide ${index === currentSlide ? 'active' : ''}`}>
            <div className="slide-content">
              <div className="slide-header">
                <h1 className="pharmora-title">
                  <span className="u-red">U</span><span className="pharmora-blue">PHARMORA - 1.0</span>
                </h1>
                <div className="title-underline"></div>
              </div>

              <div className="slide-subtitle national-conference">{slide.subtitle}</div>

              <div className="year-divider">
                <div className="year-line orange"></div>
                <div className="year-text purple">2025</div>
                <div className="year-line orange"></div>
              </div>

              <div className="organized-by">ORGANIZED BY</div>

              <div className="university-info">
                <h3 className="faculty-text">{slide.organizer}</h3>
              </div>

              <div className="slide-description">
                <p className="theme-quote">"{slide.description}"</p>
              </div>

              <div className="theme-section">
                <div className="conference-code green">{slide.theme}</div>
              </div>
            </div>
          </div>
        ))}

        <div className="slide-controls">
          <button className="slide-btn" onClick={prevSlide}>‹</button>
          <button className="slide-btn" onClick={nextSlide}>›</button>
        </div>

        <div className="slide-indicators">
          {slides.map((_, index) => (
            <button
              key={index}
              className={`indicator ${index === currentSlide ? 'active' : ''}`}
              onClick={() => goToSlide(index)}
            />
          ))}
        </div>
      </div>

      <div className="countdown">
        <h3>Conference Countdown</h3>
        <div className="countdown-timer">
          <div className="time-unit">
            <span className="number">{timeLeft.days || 0}</span>
            <span className="label">Days</span>
          </div>
          <div className="time-unit">
            <span className="number">{timeLeft.hours || 0}</span>
            <span className="label">Hours</span>
          </div>
          <div className="time-unit">
            <span className="number">{timeLeft.minutes || 0}</span>
            <span className="label">Minutes</span>
          </div>
          <div className="time-unit">
            <span className="number">{timeLeft.seconds || 0}</span>
            <span className="label">Seconds</span>
          </div>
        </div>
      </div>

      <button className="btn cta-btn">Register Now</button>

      <div className="about-sections">
        <div className="about-section">
          <h3>ABOUT PHARMORA - 1.0</h3>
          <p className="conference-subtitle">
            National Conference on Pharmaceutical Sciences
          </p>
          <p>
            PHARMORA - 1.0 is a premier national conference organized by the Faculty of Pharmacy,
            United University Prayagraj. This conference brings together leading pharmaceutical
            researchers, academicians, industry experts, and students to foster innovation for
            a healthier tomorrow and navigate the future of pharmaceutical sciences.
          </p>
          <p>
            <em>Join us in exploring cutting-edge research, innovative drug discovery methods,
              and the latest developments in pharmaceutical technology.</em>
          </p>
        </div>

        <div className="about-section">
          <h3>CONFERENCE HIGHLIGHTS</h3>
          <p>
            • <strong>Keynote Sessions</strong> by renowned pharmaceutical experts<br />
            • <strong>Research Paper Presentations</strong> in pharmaceutical sciences<br />
            • <strong>Interactive Workshops</strong> on drug discovery and development<br />
            • <strong>Industry Networking</strong> with pharmaceutical leaders<br />
            • <strong>Student Research Competitions</strong> with attractive prizes<br />
            • <strong>Exhibition</strong> of latest pharmaceutical technologies
          </p>
        </div>

        <div className="about-section">
          <h3>WHO SHOULD ATTEND</h3>
          <p>
            This conference is designed for pharmaceutical researchers, faculty members,
            pharmacy students, industry professionals, regulatory experts, and healthcare
            practitioners. Whether you're involved in drug discovery, pharmaceutical
            manufacturing, clinical research, or pharmacy practice, PHARMORA - 1.0 offers
            valuable insights and networking opportunities in pharmaceutical sciences.
          </p>
        </div>
      </div>
    </section>
  );
};

export default Home;
